    def update_buttonOnButtonClick( self, event ):
        # Update the options
        current_options = options_in_db(type_ = self.mode) # update from database
        self.current_options = Option(current_options)

        self.year_listBox.Clear() # Clear all Choices
        self.year_listBoxChoices = [tup[1] for tup in current_options['accountingyear']] # Update the Choices
        self.year_listBox.AppendItems(self.year_listBoxChoices) # Renew all Choices
        self.clear_year_buttonOnButtonClick(event=event) # Clear all selections

        self.item_listBox.Clear()
        self.item_listBoxChoices = [tup[1] for tup in current_options['item']]
        self.item_listBox.AppendItems(self.item_listBoxChoices)
        self.clear_item_buttonOnButtonClick(event=event)

        self.crop_listBox.Clear()
        self.crop_listBoxChoices = [tup[1] for tup in current_options['crop']]
        self.crop_listBox.AppendItems(self.crop_listBoxChoices)
        self.clear_crop_buttonOnButtonClick(event=event)

        self.city_listBox.Clear()
        self.city_listBoxChoices = [tup[1] for tup in current_options['city']]
        self.city_listBox.AppendItems(self.city_listBoxChoices)
        self.clear_city_buttonOnButtonClick(event=event)

