    def update_progress_bar(self, count, total):
        progress = math.ceil((count / total) * 100)
        self.process_bar.SetValue(progress)
        
    
    def start_buttonOnButtonClick( self, event ):
        search_payload = {}
        required_attributes = ["year_selected", "item_selected", "crop_selected", "city_selected"]

        if not all(hasattr(self, attr) for attr in required_attributes):
            wx.LogError("尚未選取所有選項")
            raise ValueError("Need to Select all options")
        
        self.process_bar.SetValue(0)
        
        if hasattr(self, "year_selected"):
            search_payload['year'] = [self.current_options.value_dict("year", True)[i] for i in self.year_selected]
        if hasattr(self, "item_selected"):
            search_payload['item'] = [self.current_options.value_dict("item", True)[i] for i in self.item_selected]
        if hasattr(self, "crop_selected"):
            search_payload['crop'] = [self.current_options.value_dict("crop", True)[i] for i in self.crop_selected]
        if hasattr(self, "city_selected"):
            search_payload['city'] = [self.current_options.value_dict("city", True)[i] for i in self.city_selected]
        
        # Generate all combinations
        combinations = product(search_payload['year'], search_payload['item'], search_payload['crop'], search_payload['city'])

        # Calculate the total number of combinations
        total_combinations = len(search_payload['year']) * len(search_payload['item']) * len(search_payload['crop']) * len(search_payload['city'])
        
        dataset = DataContainer(mode = self.mode)
        # Iterate through the combinations with a progress bar
        for count, (a, b, c, d) in enumerate(combinations, start=1):
            sleep(0.05)
            if self.export_mode == "multiple":
                afa_scratch(savepath=self.save_to_path, mode=self.mode, export=self.export_mode, year=a, item=b, crop=c, city=d)
            elif self.export_mode == "single":
                _data = afa_scratch(savepath=self.save_to_path, mode=self.mode, export=self.export_mode, year=a, item=b, crop=c, city=d)
                if not _data is None:
                    dataset.register(year = a, item = b, crop = c, status_data = _data)

            # wx.CallAfter(self.update_progress_bar, count, total_combinations)
            wx.CallAfter(self.update_progress_bar, count, total_combinations)

        if self.export_mode == "single":
            df = dataset.to_dataframe()
            df.to_csv(f"{self.save_to_path}/batch_data.csv", index=False, encoding='big5')
        



